import React from "react";

import AspectRatio from "@mui/joy/AspectRatio";
import Avatar from "@mui/joy/Avatar";
import Box from "@mui/joy/Box";
import Card from "@mui/joy/Card";
import CardCover from "@mui/joy/CardCover";
import Chip from "@mui/joy/Chip";
import IconButton from "@mui/joy/IconButton";
import Typography from "@mui/joy/Typography";
import Favorite from "@mui/icons-material/Favorite";
import CreateNewFolder from "@mui/icons-material/CreateNewFolder";
import { BoyRounded } from "@mui/icons-material";
import { Button } from "@mui/material";
import { Stack } from "@mui/material";
import FormHelperText from "@mui/material/FormHelperText";
import { Link } from "react-router-dom";


import CardContent from '@mui/joy/CardContent';
import CardOverflow from '@mui/joy/CardOverflow';
import Divider from '@mui/joy/Divider';

export const RoomItemList = ({ rooms }) => {
    const title = rooms.title;
    const capacity = rooms.capacity;
    const amenities = rooms.amenities;
    const allows = rooms.allows;
    const donts = rooms.donts;
    const description = rooms.description;
    const price = rooms.price;
    const imgUrl = rooms.imgUrl;

    return (
        <Link to={`/room/${title}`}>
            <Card
                sx={{
                    width: "100%",
                    boxShadow: "none",
                    "--Card-padding": "0px",
                    backgroundColor: "whitesmoke"
                }}
            >
                <Box sx={{  }}>

                    <Card
                        className="cover"
                        sx={{
                            backgroundColor:"blue",
                            display:"flex",

                        }}
                    >
                        <Box>
                            <Box>
                                <AspectRatio ratio="4/3" sx={{width: 250}}>
                                        <figure >
                                            <img  src={imgUrl} loading="lazy" alt={title} />
                                        </figure>
                                </AspectRatio>
                            </Box>
                            {/* The first box acts as a container that inherits style from the CardCover */}
                            <Box
                                sx={{
                                    display: "flex",
                                    flexDirection: "column",
                                    top: "1rem",
                                }}
                            >
                                <Typography
                                    variant="h6"
                                    sx={{
                                        color: "#fff",
                                        alignSelf: "start",
                                        padding: "3rem 2rem",
                                        fontWeight: "bold",
                                        letterSpacing: 1,
                                    }}
                                >
                                    {title}
                                </Typography>

                                <Box
                                    sx={{
                                        display: "flex",
                                        height: "100%",
                                        flexDirection: "column",
                                        justifyContent: "end",
                                        alignItems: "end",
                                        gap: "1rem",
                                        alignSelf: "end",
                                        padding: "3rem 2rem",
                                    }}
                                >
                                    <Box sx={{ ml: "auto" }}>
                                        <IconButton size="sm" color="neutral">
                                            <Favorite />
                                        </IconButton>

                                        <IconButton
                                            size="sm"
                                            color="neutral"
                                            sx={{ ml: "0.5rem" }}
                                        >
                                            <CreateNewFolder />
                                        </IconButton>
                                    </Box>

                                    <Chip
                                        variant="outlined"
                                        color="neutral"
                                        size="sm"
                                        sx={{
                                            borderRadius: "sm",
                                            ml: "auto",
                                            display: "flex",
                                        }}
                                    >
                                        {capacity && (
                                            <div>
                                                {Array(capacity)
                                                    .fill()
                                                    .map((_, index) => (
                                                        <BoyRounded
                                                            style={{
                                                                color: "#fff",
                                                            }}
                                                        />
                                                    ))}
                                            </div>
                                        )}
                                        ;
                                    </Chip>

                                    <Stack>
                                        <Typography
                                            sx={{ fontSize: "5rem", color: "#fff" }}
                                        >
                                            $ {price}
                                        </Typography>

                                        <FormHelperText
                                            sx={{ color: "#fff", alignSelf: "end" }}
                                        >
                                            {" "}
                                            person per night
                                        </FormHelperText>
                                    </Stack>

                                    <Button variant="contained" color="primary">
                                        RESERVATION
                                    </Button>
                                </Box>
                            </Box>
                        </Box>
                    </Card>
                </Box>
            </Card>
        </Link>
    );
};





export default function RowCard() {
  return (
    <Card
      orientation="horizontal"
      variant="outlined"
      sx={{ width: 260, bgcolor: 'background.body' }}
    >
      <CardOverflow>
        <AspectRatio ratio="1" sx={{ width: 90 }}>
          <img
            src="https://images.unsplash.com/photo-1507833423370-a126b89d394b?auto=format&fit=crop&w=90"
            srcSet="https://images.unsplash.com/photo-1507833423370-a126b89d394b?auto=format&fit=crop&w=90&dpr=2 2x"
            loading="lazy"
            alt=""
          />
        </AspectRatio>
      </CardOverflow>
      <CardContent sx={{ px: 2 }}>
        <Typography fontWeight="md" textColor="success.plainColor" mb={0.5}>
          Yosemite Park
        </Typography>
        <Typography level="body2">California, USA</Typography>
      </CardContent>
      <Divider />
      <CardOverflow
        variant="soft"
        color="primary"
        sx={{
          px: 0.2,
          writingMode: 'vertical-rl',
          textAlign: 'center',
          fontSize: 'xs2',
          fontWeight: 'xl2',
          letterSpacing: '1px',
          textTransform: 'uppercase',
        }}
      >
        Ticket
      </CardOverflow>
    </Card>
  );
}
